	,change: function(x,y,initial) {
		var dx = 0;
		var dy = 0;
		var tx = (x - this.level.worldX) / 4 | 0;
		var ty = (y - this.level.worldY) / 4 | 0;
		var distLeft = tx;
		var distUp = ty;
		var distRight = this.width - 1 - tx;
		var distDown = this.height - 1 - ty;
		var mind = distLeft;
		if(distUp < mind) {
			mind = distUp;
		}
		if(distRight < mind) {
			mind = distRight;
		}
		if(distDown < mind) {
			mind = distDown;
		}
		if(mind == distUp) {
			dy = -1;
		}
		if(mind == distDown) {
			dy = 1;
		}
		if(mind == distLeft) {
			dx = -1;
		}
		if(mind == distRight) {
			dx = 1;
		}
		tx += dx;
		ty += dy;
		var _g = 0;
		var _g1 = this.project.levels;
		while(_g < _g1.length) {
			var nextLevel = _g1[_g];
			++_g;
			if(nextLevel.identifier == this.level.identifier) {
				continue;
			}
			if(HxOverrides.substr(nextLevel.identifier,0,1) != HxOverrides.substr(this.level.identifier,0,1)) {
				continue;
			}
			var nextX = nextLevel.worldX;
			var nextY = nextLevel.worldY;
			if(nextX > x || nextY > y || nextX + nextLevel.pxWid < x || nextY + nextLevel.pxHei < y) {
				continue;
			}
			this.changeTo(nextLevel);
			this.saveEntryPoint(x,y,dx,dy);
			if(!initial) {
				Game.inst.onLevelChange();
			}
			this.timer = 0;
			this.isFirstLevel = false;
			return true;
		}
		return false;
	}
